import React from 'react';
import './assetss/css/App.css';
import "bootstrap/dist/css/bootstrap.css";

import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Comuna from './components/Comuna';
import Editar from './components/Editar';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
function App() {
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route path="/" exact render ={ props=> ( <Login {...props} />)}></Route>
          <Route path="/dashboard" exact render ={ props=> ( <Dashboard {...props} />)}></Route>
          <Route path="/Comuna" exact render ={ props=> ( <Comuna {...props} />)}></Route>
          <Route path="/Editar" exact render ={ props=> ( <Editar {...props} />)}></Route>
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
